import React from "react";

class SearchBar extends React.Component {
  render() {
    return (
      <div className="ui search">
        <div className="ui icon input">
          <input
            className="prompt"
            type="text"
            placeholder="Common passwords..."
          />
          <i className="search icon" />
        </div>
      </div>
    );
  }
}

export default SearchBar;
